function getCharacterClassDataObject(className, allClasses) {
    for (let i = 0; i < allClasses.length; i++) {
        if (allClasses[i].className === className) {
            return allClasses[i];
        }
    }
    console.log("error: class could not be found");
    return null;
}

function getCharacterColor(characterColors, characterClass) {
    for (let i = 0; i < characterColors.length; i++) {
        if (characterColors[i].className === characterClass) {
            return characterColors[i];
        }
    }
    console.log("error: color could not be found");
    return null;
}

function getStatsAtLevel(characterDataObject, level) {
    let index = (level / 5) - 1;
    let levelData = characterDataObject.levelData[index];
    if(levelData.level === level) {
        return levelData.stats;
    }
    console.log("error: level cannot be found");
    return null;
}


function getCharacterClassDataInRange(startLevel, endLevel, characterClassData) {

    let startIndex = (startLevel / 5) - 1;
    let startLevelData = characterClassData.levelData[startIndex];

    let endIndex = (endLevel / 5) - 1;
    let endLevelData = characterClassData.levelData[endIndex];

    if (startLevelData.level === startLevel && endLevelData.level === endLevel) {
        let sliced = characterClassData.levelData.slice(startIndex, endIndex + 1);
        let clone = Object.assign({}, characterClassData);
        clone.levelData = sliced;
        return clone;
    }

    console.log("error: something went wrong slicing the array");
    return null;
}


function getModifiedStatColor(statName, allStatColors, modifier, colors) {
    const statColorObject = getStatColorObject(allStatColors, statName);
    const modifiedColorValue = getModifiedColorValue(statColorObject, colors, modifier);
    return modifiedColorValue;
}

function getStatColorObject(allStatColors, statName) {
    for (let i = 0; i < allStatColors.length; i++) {
        if (allStatColors[i].statName === statName) {
            return allStatColors[i];
        }
    }
    console.log('error: statcolorobject could not be found');
    return null;
}

function getModifiedColorValue(statColorObject, colors, modifier) {
    const colorCopy = Object.assign({}, statColorObject.color);

    for (let j = 0; j < colors.length; j++) {
        let currentColor = colors[j];
        let colorValue = statColorObject.color[colors[j]];
        let modifiedColorValue = colorValue - modifier;

        if (modifiedColorValue < 0) {
            modifiedColorValue = 0
        }
        colorCopy[currentColor] = modifiedColorValue;
    }
    return colorCopy;
}